import SearchBar from "../Shared/SearchBar";
import { Container,Row,Col } from "reactstrap";
import Subtitle from './../shared/Subtitle';

const Home = () => {
    return(<>
    {/* --------------------hero section------------------- */}
    <section>
        <Container>
           <Row>
          <Col lg='6'>
            <div className="hero__content">
              <div className="hero__subtitle align-items-center">
                   <Subtitle></Subtitle>
              </div>
            </div>
          </Col>
           </Row>
        </Container>
        </section></>
    
    ) ;
};

export default Home;
